import React, { useState, memo } from 'react'
import  { Box, Grid, Paper } from '@mui/material'
import { BaseGraph } from './BaseGraph';
import { defaultGraphScheme } from '../tools/graphtools';


export const HomeGraph = () => {
    console.log('enter - HomeGraph')

    return (
        <>
            <Paper 
                elevation={4}         
                sx={{ flexGrow: '1',
                        minWidth: '200px',
                        color: 'white',
                        backgroundColor: 'white'}}>
                <BaseGraph 
                    drawerOpen={false}
                    name={'gene'}
                    genes={['BRCA1','BRCA2']}
                    organs={[]}
                    syndromes={[]}
                    diseases={[]}
                    finalVerdict='Confimred'
                    graphScheme={defaultGraphScheme}
                />
            </Paper>
            <div style={{ flexGrow:'1', minWidth:'200px',  color:'white', backgroundColor: 'black' }}>
                item 1
            </div>
            <div style={{ flexGrow:'1', minWidth:'200px', color:'white', backgroundColor: 'green' }}>
                item 2
            </div>
            <div style={{ flexGrow:'1', minWidth:'200px', color:'white', backgroundColor: 'blue' }}>
                item 3
            </div>
        </>
    )
}
